import React, { useEffect, useState } from "react";
import { Link } from "react-router-dom";
import UserSidebar from "./UserSidebar";
import { useParams } from "react-router-dom";
import axios from "axios";

const baseUrl = 'http://127.0.0.1:8000/api/elearning'


function TakeQuiz() {
  const [questionData, setquestionData]=useState([]);
  const {quiz_id}=useParams();
  const studentId= localStorage.getItem('studentId')
  

  useEffect(() => {
    try{
      axios.get(baseUrl+'/quiz-questions/'+quiz_id).then((res)=>{
        setquestionData(res.data);
      });
    }catch(error){
      console.log(error)
    }
    document.title='Attempt Quiz';
  }, []);

  return (
    <div className="container mt-4">
      <div className="row">
        <aside className="col-md-3"><UserSidebar /></aside>
        <section className="col-md-9">
          <h4 className="mb-3 border-bottom pb-1">Quiz Title</h4>
            <div className="card">
            <h5 className="card-header">Question Title </h5>
            <div className='card-body'>
                <table className="table table-bordered">
                    <tbody>
                    {questionData.map((row, index)=>
                      <>
                        <tr>
                          <td>
                            <button className="btn btn-outline-secondary">Option 1</button>
                          </td>
                        </tr>
                        <tr>
                          <td>
                            <button className="btn btn-outline-secondary">Option 1</button>
                          </td>
                        </tr>
                        <tr>
                          <td>
                            <button className="btn btn-outline-secondary">Option 1</button>
                          </td>
                        </tr>
                        <tr>
                          <td>
                            <button className="btn btn-outline-secondary">Option 1</button>
                          </td>
                        </tr>
                        </>
                    )}
                    </tbody>
                </table>
            </div>
            </div>
        </section>
      </div>
    </div>
  );
}
export default TakeQuiz;
